Decorated headpieces precede some of the texts:
f. 2:24r heart-shaped decoration with palmettes at the corners;
f. 2:13r, 2:48[a] recto interlace decoration with palmettes at the corners;
f. 2:108r decoration with vegetal scrolls, palmettes at the corners.

Friezes precede some of the texts:
ff. 2:78v, 2:101v, 2:103r, 2:104v, 2:105v, 2:106r rope in red ink or black ink;
f. 2:84r rectangular frieze filled with a scroll motif in black and red ink;
f. 2:100r frieze formed by a double ribbon with two knots.
